import React, { Component } from "react";
import { Button, View, Text, TouchableOpacity } from "react-native";
import {
  Table,
  TableWrapper,
  Row,
  Rows,
  Col,
  Cols,
  Cell,
} from "react-native-table-component";

import courseList from "./data/courses.json";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this._deleteCourse = this._deleteCourse.bind(this);
    this.state = {
      courseList: courseList,
      HeadTable: ["Name", "Preis", "Beschreibung", ""],
      DataTable: [
        ["1", "2", "3"],
        ["a", "b", "c"],
        ["1", "2", "3"],
        ["a", "b", "c"],
        ["1", "2", "3"],
      ],
    };
  }
  _deleteCourse(id) {
    const { courseList } = this.state;
    this.setState({
      courseList: courseList.filter((fitness) => fitness.id !== id),
    });
    console.log("Deleted");
    return;
  }
  render() {
    const state = this.state;
    const courseList = this.state.courseList.map((fitness) => [
      fitness.name,
      fitness.price,
      fitness.description,
    ]);
    <TouchableOpacity onPress={() => this._deleteCourse}>
      <View>
        <Text>button</Text>
      </View>
    </TouchableOpacity>;
    return (
      <View>
        <Table borderStyle={{ borderWidth: 1, borderColor: "#000000" }}>
          <Row
            data={state.HeadTable}
            // style={styles.HeadStyle}
            // textStyle={styles.TableText}
            //onPress={() => alert("Heyho!")}
          />
          {courseList.map((fitness, index) => (
            <Row key={index} data={fitness} />
          ))}
          <Row type={Button} />
        </Table>
      </View>
    );
  }
}

export default Fitnessinfo;

